import axios from 'axios'

export const registration = async (email, password) => {
    try {
        const response = await axios.post(`http://localhost:5001/api/auth/registration`, {
            email,
            password
        })
        alert(response)
    } catch (e) {
        alert(e.response.data)
    }

}
